// export default axiosInstance


export async function registerUser(usuario) {
    return await axios({
      method: "POST",
      url: `${API_URL}/usuario/register/`,
      data:usuario
    })
      .then((response) => {
          return response.data})
      .catch(function (error) {
        if (error.reponse) {
          return error.response;
        }
      });
  }
